jQuery(document).ready(function($){     
    $(".search-item span").click(function(){
        if ($('.navigation-search').is(":visible")) {
            $(this).parent().removeClass('current-menu-item');
            $(this).parent().removeClass('sfHover');
            $(this).css('opacity','1');
            $('.navigation-search').fadeOut(50);
            $('.search-item i').replaceWith('<i class="fa s-icon"></i>');
            return false;
        } else {
            $(this).parent().addClass('current-menu-item');
            $(this).parent().removeClass('sfHover');
            $(this).css('opacity','0.9');
            $('.navigation-search').fadeIn(50);         
            $('.navigation-search .input-search').focus();
            $('.search-item i').replaceWith('<i class="fa s-close"></i>');
            return false;
        }
    });
});


